import React from 'react';
import { Router, Route, Switch } from "react-router";
import { routerIndex } from '../components/routes/index-routes';

const RouterIndex = () => {
    return (
        <React.Fragment>
            <Router></Router>
            <Switch>
                {routerIndex.map((router, index) => {
                    return (
                        <Route
                            exact={router.exact}
                            path={router.path}
                            components={router.components}
                            key={index}
                        />
                    )
                })}
            </Switch>
        </React.Fragment>
    );
}

export default RouterIndex;
